(2, 1, '2013-04-03 01:03:35', '2013-04-03 01:03:35', 'We have complied the following information and forms to help you with your envelope ordering experience. Check this page frequently, as additional information will be posted as they become available.\r\n\r\n&nbsp;\r\n<div id="slim-line"></div>\r\n&nbsp;\r\n<ul>\r\n	<li><a href="http://azenv.youareheremedia.com/wp-content/uploads/2013/04/STANDARD-ENVELOPE-SIZE-CHART.pdf" target="_blank">Standard Envelope Size Chart</a></li>\r\n	<li><a href="http://azenvelope.com/wp-content/uploads/2013/05/CREDIT_APPLICATION.pdf" target="_blank">Credit Application</a></li>\r\n	<li><a href="http://azenvelope.com/wp-content/uploads/2015/02/AZ-Resale-Form-5000.pdf">AZ Resale Form 5000</a></li>\r\n	<li><a href="http://azenvelope.com/wp-content/uploads/2013/05/CONVERTING_GUIDELINES.pdf" target="_blank">Converting Guideline</a></li>\r\n</ul>', 'Helpful Information', '', 'trash', 'open', 'open', '', 'helpful-information__trashed', '', '', '2016-10-08 00:00:02', '2016-10-08 00:00:02', '', 0, 'http://azenv.youareheremedia.com/?page_id=2', 0, 'page', '', 0),
