(19, 1, '2013-04-07 04:47:35', '2013-04-07 04:47:35', 'Thank you for viewing our samples page. Arizona Envelope offers several commercial envelope options, including multi-window envelopes. We also offer select printed envelopes using one, two or four colors. Contact us today for a quote on your next custom envelope order!\r\n\r\n&nbsp;\r\n<div id="sample-left">\r\n\r\n<img src="/wp-content/themes/imagethemeresponsive/images/2-Way-Remittance.jpg" alt="" border="0" />\r\n\r\n2-Way Remittance\r\n\r\n</div>\r\n<div id="sample-right">\r\n\r\n<img src="/wp-content/themes/imagethemeresponsive/images/4-color.jpg" alt="" border="0" />\r\n4-color\r\n\r\n</div>\r\n<div style="clear: both;"></div>\r\n<div id="sample-left">\r\n\r\n<img src="/wp-content/themes/imagethemeresponsive/images/Security-Strip.jpg" alt="" border="0" />\r\nSecurity Strip\r\n\r\n</div>\r\n<div id="sample-right">\r\n\r\n<img src="/wp-content/themes/imagethemeresponsive/images/Door-hanger.jpg" alt="" border="0" />\r\nDoor hanger\r\n\r\n</div>\r\n<div style="clear: both;"></div>\r\n<div id="sample-left">\r\n\r\n<img src="/wp-content/themes/imagethemeresponsive/images/Door-Key.jpg" alt="" border="0" />\r\nDoor Key\r\n\r\n</div>\r\n<div id="sample-right">\r\n\r\n<img src="/wp-content/themes/imagethemeresponsive/images/Colored.jpg" alt="" border="0" />\r\nColored\r\n\r\n</div>\r\n<div style="clear: both;"></div>\r\n<div id="sample-left">\r\n\r\n<img src="/wp-content/themes/imagethemeresponsive/images/Expansion.jpg" alt="" border="0" />\r\nExpansion\r\n\r\n</div>\r\n<div id="sample-right">\r\n\r\n<img src="/wp-content/themes/imagethemeresponsive/images/Zipstick.jpg" alt="" border="0" />\r\nZipstick\r\n\r\n</div>\r\n<div style="clear: both;"></div>\r\n<div id="sample-left">\r\n\r\n<img src="/wp-content/themes/imagethemeresponsive/images/InnerOffice-back.jpg" alt="" border="0" />\r\nInnerOffice back\r\n\r\n</div>\r\n<div id="sample-right">\r\n\r\n<img src="/wp-content/themes/imagethemeresponsive/images/InnerOffice-front.jpg" alt="" border="0" />\r\nInnerOffice front\r\n\r\n</div>\r\n<div style="clear: both;"></div>\r\n<div id="sample-left">\r\n\r\n<img src="/wp-content/themes/imagethemeresponsive/images/Latex.jpg" alt="" border="0" />\r\nLatex\r\n\r\n</div>\r\n<div id="sample-right">\r\n\r\n<img src="/wp-content/themes/imagethemeresponsive/images/Open-End.jpg" alt="" border="0" />\r\nOpen End\r\n\r\n</div>\r\n<div style="clear: both;"></div>\r\n<div id="sample-left">\r\n\r\n<img src="/wp-content/themes/imagethemeresponsive/images/Open-Side.jpg" alt="" border="0" />\r\nOpen Side\r\n\r\n</div>\r\n<div id="sample-right">\r\n\r\n<img src="/wp-content/themes/imagethemeresponsive/images/Remittance.jpg" alt="" border="0" />\r\nRemittance\r\n\r\n</div>\r\n<div style="clear: both;"></div>\r\n<div id="sample-left">\r\n\r\n<img src="/wp-content/themes/imagethemeresponsive/images/Clasp.jpg" alt="" border="0" />\r\nClasp\r\n\r\n</div>\r\n<div id="sample-right">\r\n\r\n<img src="/wp-content/themes/imagethemeresponsive/images/String-Button.jpg" alt="" border="0" />\r\nString &amp; Button\r\n\r\n</div>\r\n<div style="clear: both;"></div>\r\n<div id="sample-left">\r\n\r\n<img src="/wp-content/themes/imagethemeresponsive/images/Tint.jpg" alt="" border="0" />\r\nTint\r\n\r\n</div>\r\n<div id="sample-right">\r\n\r\n<img src="/wp-content/themes/imagethemeresponsive/images/Window.jpg" alt="" border="0" />\r\nWindow\r\n\r\n</div>\r\n<div style="clear: both;"></div>\r\n<div id="sample-left">\r\n\r\n<img src="/wp-content/themes/imagethemeresponsive/images/First-class-Border-with-Zipstick.jpg" alt="" border="0" />\r\nFirst Class Border with Zipstick\r\n<div style="clear: both;"></div>\r\n</div>', 'View Samples', '', 'trash', 'closed', 'open', '', 'samples__trashed', '', '', '2016-10-08 00:00:02', '2016-10-08 00:00:02', '', 0, 'http://azenv.youareheremedia.com/?page_id=19', 0, 'page', '', 0),
(24, 1, '2013-04-14 18:23:02', '2013-04-14 18:23:02', 'Arizona Envelope Company has been manufacturing and printing envelopes in Arizona for over 30 years. We have recently added new equipment and are planning for more in the future. Our goal is to meet the expedient and exacting demands of our customers.\r\n\r\n&nbsp;\r\n\r\nArizona Envelope has a versatile selection of equipment to run any envelope our customers require. For a view of our complete equipment list <a title="Equipment" href="http://azenvelope.com/equipment/">click here</a>.\r\n\r\n&nbsp;\r\n\r\nArizona Envelope Company caters to the Trade Industry. The representatives can assist with quotes, status inquiries, technical questions relating to printing and envelope converting and turn times for the jobs or prospective jobs. They work with both the production personnel and estimating personnel to get the information the customer needs. For contact information see our <a title="Contact Us" href="http://azenvelope.com/contact-us/">Contact Us</a> page.\r\n\r\n&nbsp;\r\n\r\nThis web site is being developed as a tool for our customers. Currently we have an electronic quote form to communicate directly with the estimating departments. This is intended as a back up to our service representatives. It offers a way to initiate a request on weekends, at night or any other time the representative may be unavailable. For our clients that have inventory with us, we are working on a portal so they can check inventory levels as well as release stock for delivery anytime they choose.\r\n\r\n&nbsp;\r\n\r\nIf you have any suggestions, comments or requests on our web site <a title="Contact Us" href="http://azenvelope.com/contact-us/">please contact us at 800-540-6883.</a>', 'About Us', '', 'trash', 'closed', 'closed', '', 'sample__trashed', '', '', '2016-10-08 00:00:02', '2016-10-08 00:00:02', '', 0, 'http://azenv.youareheremedia.com/?page_id=24', 0, 'page', '', 0),
(28, 1, '2013-04-14 21:44:14', '2013-04-14 21:44:14', '<span style="color: #ff3715;"><strong>Arizona Envelope Company</strong></span>\n\n<em>7248 S. Harl Avenue</em>\n<em> Tempe, AZ 85283</em>\n\n<span style="color: #ff3715;"><strong>Customer Service</strong></span>\nToll Free: <b>(800) 540-6883</b>\nPhone: <strong>(480) 839-7676</strong>\nFax:<strong> (480) 897-6824</strong>\n<b>\nSEND US YOUR FEEDBACK:</b>\nDo you have a question, comment or suggestion to pass along to us? Please complete the form below to send us a message. A representative will be in contact with you shortly.\n\n&nbsp;\n<div id="slim-line"></div>\n&nbsp;\n\n[contact-form-7 id="80" title="Contact form 1"]', 'Contact Us', '', 'trash', 'open', 'open', '', 'contact-us__trashed', '', '', '2016-10-08 00:00:02', '2016-10-08 00:00:02', '', 0, 'http://azenv.youareheremedia.com/?page_id=28', 0, 'page', '', 0),
(38, 1, '2015-01-20 02:28:30', '2015-01-20 02:28:30', 'Are you sending us preprinted stock that Arizona Envelope will die cut and convert into envelopes? You must use one of our Layouts when setting up your artwork.Â  Please see the following list of the most popular layouts.\n\n&nbsp;\n<div id="slim-line"></div>\n&nbsp;\n<ul>\n	<li><strong><a href="/wp-content/uploads/diecuts/Die_Layout_Instructions.pdf" target="_blank">Die Layout Instructions</a></strong></li>\n	<li><strong><a href="/wp-content/uploads/diecuts/Hobbs_Layout_Instructions.pdf" target="_blank">Hobbs Layout Instructions</a></strong></li>\n	<li><a href="http://azenvelope.com/wp-content/uploads/2016/02/9-Remittance-6up-on-23x35-Outside-Bleeds.pdf">#9 Remittance 6up on 23x35 Outside Bleeds</a></li>\n	<li><a href="/wp-content/uploads/diecuts/10_1_Up_on_11_x_17_Outside_Bleed.pdf" target="_blank">#10 1 Up on 11 x 17 Outside Bleed</a></li>\n	<li><a href="/wp-content/uploads/diecuts/10_2_Up_on_17_1-2_x_23_OutsideBleed.pdf" target="_blank">#10 2 Up on 17 1-2 x 23 OutsideBleed</a></li>\n	<li><a href="/wp-content/uploads/diecuts/10_4_Up_on_19_x_25_Outside_Bleed.pdf" target="_blank">#10 4 Up on 19 x 25 Outside Bleed</a></li>\n	<li><a href="http://azenvelope.com/wp-content/uploads/2015/01/10_8_up_on_25_x_38_BLEED.pdf">#10_8_up_on_25_x_38_BLEED</a></li>\n	<li><a href="/wp-content/uploads/diecuts/10_Open_Side_4_Up_on_20_x_28_Outside_Bleeds.pdf" target="_blank">#10 Open Side 4 Up on 20 x 28 Outside Bleeds</a></li>\n	<li><a href="http://azenvelope.com/wp-content/uploads/2016/02/10-Open-Side-8-up-on-28x40-Outside-Bleeds.pdf">#10 Open Side 8 up on 28x40 Outside Bleeds</a></li>\n	<li><a href="http://azenvelope.com/wp-content/uploads/2013/12/11-1up-12.5-x-19-Outside-Bleeds.pdf">#11 1 Up on 12.5 x 19 Outside Bleeds</a></li>\n	<li><a href="http://azenvelope.com/wp-content/uploads/2013/04/6-x-9-Open-End-2-Up-on-19-x-25-Oustide-Bleed.pdf">6 x 9 Open End 2 Up on 19 x 25 Oustide Bleed</a></li>\n	<li><a href="/wp-content/uploads/diecuts/6_x_9_Open_Side_1_Up_on_11-2_x_17_Outside_Bleed.pdf" target="_blank">6 x 9 Open Side 1 Up on 11-2 x 17 Outside Bleed</a></li>\n	<li><a href="/wp-content/uploads/diecuts/9_x_12_Open_End_1_Up_on_17_1-2_x_23_Outside_Bleed.pdf" target="_blank">9 x 12 Open End 1 Up on 17 1-2 x 23 Outside Bleed</a></li>\n	<li><a href="/wp-content/uploads/diecuts/9_x_12_Open_End_2_Up_on_23_x_35_Outside_Bleed.pdf" target="_blank">9 x 12 Open End 2 Up on 23 x 35 Outside Bleed</a></li>\n	<li><a href="/wp-content/uploads/diecuts/9_x_12_Open_Side_1_Up_on_17_1-2_x_23_Outside_Bleed.pdf" target="_blank">9 x 12 Open Side 1 Up on 17 1-2 x 23 Outside Bleed</a></li>\n	<li><a href="/wp-content/uploads/diecuts/9_x_12_Open_Side_2_Up_on_23_x_35_Outside_Bleed.pdf" target="_blank">9 x 12 Open Side 2 Up on 23 x 35 Outside Bleed</a></li>\n	<li><a href="http://azenvelope.com/wp-content/uploads/2013/12/10-x-13-Open-End-1-up-17_5-x-23-Outside-Bleeds.pdf">10 x 13 Open End 1 up 17_5 x 23 Outside Bleeds</a></li>\n	<li><a href="http://azenvelope.com/wp-content/uploads/2013/12/10-x-13-Open-End-2-up-on-23-x-35-Outside-Bleeds.pdf">10 x 13 Open End 2 up on 23 x 35 Outside Bleeds</a></li>\n	<li><a href="http://azenvelope.com/wp-content/uploads/2013/12/10-x-13-Open-Side-1-Up-on-17_5-x-23-Outside-Bleeds.pdf">10 x 13 Open Side 1 Up on 17_5 x 23 Outside Bleeds</a></li>\n	<li><a href="http://azenvelope.com/wp-content/uploads/2013/12/10-x-13-Open-Side-2-Up-on-23-x-35-Outside-Bleeds.pdf">10 x 13 Open Side 2 Up on 23 x 35 Outside Bleeds</a></li>\n	<li><a href="http://azenvelope.com/wp-content/uploads/2016/02/A-6-2up-on-12-x-18-Outside-Bleeds.pdf">A-6 2up on 12 x 18 Outside Bleeds</a></li>\n	<li><a href="http://azenvelope.com/wp-content/uploads/2013/12/A-7-4-Up-on-19x25-Outside-Bleeds.pdf">A-7 4 Up on 19x25 Outside Bleeds</a></li>\n	<li><a href="http://azenvelope.com/wp-content/uploads/2013/12/A-7-4-Up-on-19x25-Outside-Bleeds-Machine-Insertable.pdf">A-7 4 Up on 19x25 Outside Bleeds Machine Insertable</a></li>\n</ul>\n&nbsp;\n<div id="slim-line"></div>\n&nbsp;\n\nIf you do not see the layout you need, please contact us and we will get it for you.Â  Here is the information we will need to produce your layout:\n1. What sheet size you are printing on?Â  2. How many up you will print?Â  3. Are there any outside or inside bleeds?', 'Layouts & Die Lines', '', 'trash', 'open', 'closed', '', 'die-lines__trashed', '', '', '2016-10-08 00:00:02', '2016-10-08 00:00:02', '', 0, 'http://azenv.youareheremedia.com/?page_id=38', 0, 'page', '', 0),
