(1078, 1, '2013-05-22 15:04:53', '2013-05-22 15:04:53', 'Due to recent paper increases, one October 2013 and then for March 2014, we have to increase our prices effective immediately.Â  Please contact your salesperson for further information.\n\nHere is a copy of the most recent letter from our paper supplier.\n\n<a href="http://azenvelope.com/wp-content/uploads/2013/05/International_Paper_-_Converting_Papers_Price_Increase_-_March_2014.pdf">International_Paper_-_Converting_Papers_Price_Increase_-_March_2014</a>', 'News', '', 'trash', 'closed', 'open', '', 'news__trashed', '', '', '2016-10-08 00:00:02', '2016-10-08 00:00:02', '', 0, 'http://azenv.youareheremedia.com/?page_id=131', 0, 'page', '', 0),
