(1251, 3, '2016-10-08 00:04:04', '2016-10-08 00:04:04', 'Arizona Envelope Company has been manufacturing and printing envelopes in Arizona for over 30 years. We have recently added new equipment and are planning for more in the future. Our goal is to meet the expedient and exacting demands of our customers.\r\nArizona Envelope has a versatile selection of equipment to run any envelope our customers require. For a view of our complete equipment list click here.\r\nArizona Envelope Company caters to the Trade Industry. The representatives can assist with quotes, status inquiries, technical questions relating to printing and envelope converting and turn times for the jobs or prospective jobs. They work with both the production personnel and estimating personnel to get the information the customer needs. For contact information see our Contact Us page.\r\nThis web site is being developed as a tool for our customers. Currently we have an electronic quote form to communicate directly with the estimating departments. This is intended as a back up to our service representatives. It offers a way to initiate a request on weekends, at night or any other time the representative may be unavailable. For our clients that have inventory with us, we are working on a portal so they can check inventory levels as well as release stock for delivery anytime they choose.\r\nIf you have any suggestions, comments or requests on our web site please contact us at 800-540-6883.', 'Company', '', 'trash', 'open', 'open', '', 'company__trashed', '', '', '2016-10-10 01:45:06', '2016-10-10 01:45:06', '', 0, 'http://www.azenvelope-old.loc/company/', 0, 'page', '', 0),
(1252, 3, '2016-10-08 00:04:04', '2016-10-08 00:04:04', 'Arizona Envelope Company has been manufacturing and printing envelopes in Arizona for over 30 years. We have recently added new equipment and are planning for more in the future. Our goal is to meet the expedient and exacting demands of our customers.\r\n\r\nArizona Envelope has a versatile selection of equipment to run any envelope our customers require. For a view of our complete equipment list <a title="Equipment" href="/equipment/">click here</a>.\r\n\r\nArizona Envelope Company caters to the Trade Industry. The representatives can assist with quotes, status inquiries, technical questions relating to printing and envelope converting and turn times for the jobs or prospective jobs. They work with both the production personnel and estimating personnel to get the information the customer needs. For contact information see our <a title="Contact Us" href="/contact-us/">Contact Us</a> page.\r\n\r\nThis web site is being developed as a tool for our customers. Currently we have an electronic quote form to communicate directly with the estimating departments. This is intended as a back up to our service representatives. It offers a way to initiate a request on weekends, at night or any other time the representative may be unavailable. For our clients that have inventory with us, we are working on a portal so they can check inventory levels as well as release stock for delivery anytime they choose.\r\n\r\nIf you have any suggestions, comments or requests on our web site <a title="Contact Us" href="tel:+18005406883">please contact us at 800-540-6883.</a>', 'About Us', '', 'publish', 'open', 'open', '', 'about-us', '', '', '2016-10-12 20:02:49', '2016-10-12 20:02:49', '', 0, 'http://www.azenvelope-old.loc/about-us/', 0, 'page', '', 0),
(1253, 3, '2016-10-08 00:04:17', '2016-10-08 00:04:17', 'This privacy policy has been compiled to better serve those who are concerned with how their \'Personally Identifiable Information\' (PII) is being used online. PII, as described in US privacy law and information security, is information that can be used on its own or with other information to identify, contact, or locate a single person, or to identify an individual in context. Please read our privacy policy carefully to get a clear understanding of how we collect, use, protect or otherwise handle your Personally Identifiable Information in accordance with our website.\r\n\r\nWhat personal information do we collect from the people that visit our blog, website or app?\r\n\r\nWhen ordering or registering on our site, as appropriate, you may be asked to enter your name, email address, mailing address, phone number or other details to help you with your experience.\r\n\r\nWhen do we collect information?\r\n\r\nWe collect information from you when you register on our site, place an order, subscribe to a newsletter, fill out a form or enter information on our site.\r\n\r\n\r\nHow do we use your information?\r\n\r\nWe may use the information we collect from you when you register, make a purchase, sign up for our newsletter, respond to a survey or marketing communication, surf the website, or use certain other site features in the following ways:\r\n\r\n      â€¢ To personalize your experience and to allow us to deliver the type of content and product offerings in which you are most interested.\r\n      â€¢ To improve our website in order to better serve you.\r\n      â€¢ To quickly process your transactions.\r\n\r\nHow do we protect your information?\r\n\r\nOur website is scanned on a regular basis for security holes and known vulnerabilities in order to make your visit to our site as safe as possible.\r\n\r\nWe use regular Malware Scanning.\r\n\r\nYour personal information is contained behind secured networks and is only accessible by a limited number of persons who have special access rights to such systems, and are required to keep the information confidential. In addition, all sensitive/credit information you supply is encrypted via Secure Socket Layer (SSL) technology.\r\n\r\nWe implement a variety of security measures when a user enters, submits, or accesses their information to maintain the safety of your personal information.\r\n\r\nAll transactions are processed through a gateway provider and are not stored or processed on our servers.\r\n\r\nDo we use \'cookies\'?\r\n\r\nYes. Cookies are small files that a site or its service provider transfers to your computer\'s hard drive through your Web browser (if you allow) that enables the site\'s or service provider\'s systems to recognize your browser and capture and remember certain information. For instance, we use cookies to help us remember and process the items in your shopping cart. They are also used to help us understand your preferences based on previous or current site activity, which enables us to provide you with improved services. We also use cookies to help us compile aggregate data about site traffic and site interaction so that we can offer better site experiences and tools in the future.\r\n\r\nWe use cookies to:\r\n      â€¢ Help remember and process the items in the shopping cart.\r\n      â€¢ Compile aggregate data about site traffic and site interactions in order to offer better site experiences and tools in the future. We may also use trusted third-party services that track this information on our behalf.\r\n\r\nYou can choose to have your computer warn you each time a cookie is being sent, or you can choose to turn off all cookies. You do this through your browser settings. Since browser is a little different, look at your browser\'s Help Menu to learn the correct way to modify your cookies.\r\n\r\nIf you turn cookies off, some features will be disabled. It won\'t affect the user\'s experience that make your site experience more efficient and may not function properly.\r\n\r\nHowever, you will still be able to place orders .\r\n\r\n\r\nThird-party disclosure\r\n\r\nWe do not sell, trade, or otherwise transfer to outside parties your Personally Identifiable Information unless we provide users with advance notice. This does not include website hosting partners and other parties who assist us in operating our website, conducting our business, or serving our users, so long as those parties agree to keep this information confidential. We may also release information when it\'s release is appropriate to comply with the law, enforce our site policies, or protect ours or others\' rights, property or safety. \r\n\r\nHowever, non-personally identifiable visitor information may be provided to other parties for marketing, advertising, or other uses.\r\n\r\nThird-party links\r\n\r\nWe do not include or offer third-party products or services on our website.\r\n\r\nGoogle\r\n\r\nGoogle\'s advertising requirements can be summed up by Google\'s Advertising Principles. They are put in place to provide a positive experience for users. https://support.google.com/adwordspolicy/answer/1316548?hl=en \r\n\r\nWe use Google AdSense Advertising on our website.\r\n\r\nGoogle, as a third-party vendor, uses cookies to serve ads on our site. Google\'s use of the DART cookie enables it to serve ads to our users based on previous visits to our site and other sites on the Internet. Users may opt-out of the use of the DART cookie by visiting the Google Ad and Content Network privacy policy.\r\n\r\nWe have implemented the following:\r\n      â€¢ Demographics and Interests Reporting\r\n\r\nWe, along with third-party vendors such as Google use first-party cookies (such as the Google Analytics cookies) and third-party cookies (such as the DoubleClick cookie) or other third-party identifiers together to compile data regarding user interactions with ad impressions and other ad service functions as they relate to our website.\r\n\r\nOpting out:\r\nUsers can set preferences for how Google advertises to you using the Google Ad Settings page. Alternatively, you can opt out by visiting the Network Advertising Initiative Opt Out page or by using the Google Analytics Opt Out Browser add on.\r\n\r\nCalifornia Online Privacy Protection Act\r\n\r\nCalOPPA is the first state law in the nation to require commercial websites and online services to post a privacy policy. The law\'s reach stretches well beyond California to require any person or company in the United States (and conceivably the world) that operates websites collecting Personally Identifiable Information from California consumers to post a conspicuous privacy policy on its website stating exactly the information being collected and those individuals or companies with whom it is being shared. - See more at: http://consumercal.org/california-online-privacy-protection-act-caloppa/#sthash.0FdRbT51.dpuf\r\n\r\nAccording to CalOPPA, we agree to the following:\r\nUsers can visit our site anonymously.\r\nOnce this privacy policy is created, we will add a link to it on our home page or as a minimum, on the first significant page after entering our website.\r\nOur Privacy Policy link includes the word \'Privacy\' and can easily be found on the page specified above.\r\n\r\nYou will be notified of any Privacy Policy changes:\r\n      â€¢ On our Privacy Policy Page\r\nCan change your personal information:\r\n      â€¢ By logging in to your account\r\n\r\nHow does our site handle Do Not Track signals?\r\nWe honor Do Not Track signals and Do Not Track, plant cookies, or use advertising when a Do Not Track (DNT) browser mechanism is in place.\r\n\r\nDoes our site allow third-party behavioral tracking?\r\nIt\'s also important to note that we allow third-party behavioral tracking\r\n\r\nCOPPA (Children Online Privacy Protection Act)\r\n\r\nWhen it comes to the collection of personal information from children under the age of 13 years old, the Children\'s Online Privacy Protection Act (COPPA) puts parents in control. The Federal Trade Commission, United States\' consumer protection agency, enforces the COPPA Rule, which spells out what operators of websites and online services must do to protect children\'s privacy and safety online.\r\n\r\nWe do not specifically market to children under the age of 13 years old.\r\n\r\nFair Information Practices\r\n\r\nThe Fair Information Practices Principles form the backbone of privacy law in the United States and the concepts they include have played a significant role in the development of data protection laws around the globe. Understanding the Fair Information Practice Principles and how they should be implemented is critical to comply with the various privacy laws that protect personal information.\r\n\r\nIn order to be in line with Fair Information Practices we will take the following responsive action, should a data breach occur:\r\nWe will notify you via email\r\n      â€¢ Within 7 business days\r\n\r\nWe also agree to the Individual Redress Principle which requires that individuals have the right to legally pursue enforceable rights against data collectors and processors who fail to adhere to the law. This principle requires not only that individuals have enforceable rights against data users, but also that individuals have recourse to courts or government agencies to investigate and/or prosecute non-compliance by data processors.\r\n\r\nCAN SPAM Act\r\n\r\nThe CAN-SPAM Act is a law that sets the rules for commercial email, establishes requirements for commercial messages, gives recipients the right to have emails stopped from being sent to them, and spells out tough penalties for violations.\r\n\r\nWe collect your email address in order to:\r\n      â€¢ Send information, respond to inquiries, and/or other requests or questions\r\n      â€¢ Process orders and to send information and updates pertaining to orders.\r\n      â€¢ Send you additional information related to your product and/or service\r\n      â€¢ Market to our mailing list or continue to send emails to our clients after the original transaction has occurred.\r\n\r\nTo be in accordance with CANSPAM, we agree to the following:\r\n      â€¢ Not use false or misleading subjects or email addresses.\r\n      â€¢ Identify the message as an advertisement in some reasonable way.\r\n      â€¢ Include the physical address of our business or site headquarters.\r\n      â€¢ Monitor third-party email marketing services for compliance, if one is used.\r\n      â€¢ Honor opt-out/unsubscribe requests quickly.\r\n      â€¢ Allow users to unsubscribe by using the link at the bottom of each email.\r\n\r\nIf at any time you would like to unsubscribe from receiving future emails, you can email us at\r\n      â€¢ Follow the instructions at the bottom of each email.\r\nand we will promptly remove you from ALL correspondence.\r\n\r\n\r\nContacting Us\r\n\r\nIf there are any questions regarding this privacy policy, you may contact us using the information below.\r\n\r\nazenvelope.com\r\n(800) 540-6883\r\n\r\nLast Edited on 2016-10-05', 'Privacy Policy', '', 'publish', 'open', 'open', '', 'privacy-policy', '', '', '2016-10-12 20:03:28', '2016-10-12 20:03:28', '', 1252, 'http://www.azenvelope-old.loc/privacy-policy/', 0, 'page', '', 0),
