pdf">6 x 9 Open End 2 Up on 19 x 25 Oustide Bleed</a></li>\r\n	<li><a href="/wp-content/uploads/diecuts/6_x_9_Open_Side_1_Up_on_11-2_x_17_Outside_Bleed.pdf" target="_blank">6 x 9 Open Side 1 Up on 11-2 x 17 Outside Bleed</a></li>\r\n	<li><a href="/wp-content/uploads/diecuts/9_x_12_Open_End_1_Up_on_17_1-2_x_23_Outside_Bleed.pdf" target="_blank">9 x 12 Open End 1 Up on 17 1-2 x 23 Outside Bleed</a></li>\r\n	<li><a href="/wp-content/uploads/diecuts/9_x_12_Open_End_2_Up_on_23_x_35_Outside_Bleed.pdf" target="_blank">9 x 12 Open End 2 Up on 23 x 35 Outside Bleed</a></li>\r\n	<li><a href="/wp-content/uploads/diecuts/9_x_12_Open_Side_1_Up_on_17_1-2_x_23_Outside_Bleed.pdf" target="_blank">9 x 12 Open Side 1 Up on 17 1-2 x 23 Outside Bleed</a></li>\r\n	<li><a href="/wp-content/uploads/diecuts/9_x_12_Open_Side_2_Up_on_23_x_35_Outside_Bleed.pdf" target="_blank">9 x 12 Open Side 2 Up on 23 x 35 Outside Bleed</a></li>\r\n	<li><a href="http://aze.dev.laneterralever.com/wp-content/uploads/2013/12/10-x-13-Open-End-1-up-17_5-x-23-Outside-Bleeds.pdf">10 x 13 Open End 1 up 17_5 x 23 Outside Bleeds</a></li>\r\n	<li><a href="http://aze.dev.laneterralever.com/wp-content/uploads/2013/12/10-x-13-Open-End-2-up-on-23-x-35-Outside-Bleeds.pdf">10 x 13 Open End 2 up on 23 x 35 Outside Bleeds</a></li>\r\n	<li><a href="http://aze.dev.laneterralever.com/wp-content/uploads/2013/12/10-x-13-Open-Side-1-Up-on-17_5-x-23-Outside-Bleeds.pdf">10 x 13 Open Side 1 Up on 17_5 x 23 Outside Bleeds</a></li>\r\n	<li><a href="http://aze.dev.laneterralever.com/wp-content/uploads/2013/12/10-x-13-Open-Side-2-Up-on-23-x-35-Outside-Bleeds.pdf">10 x 13 Open Side 2 Up on 23 x 35 Outside Bleeds</a></li>\r\n	<li><a href="http://aze.dev.laneterralever.com/wp-content/uploads/2016/02/A-6-2up-on-12-x-18-Outside-Bleeds.pdf">A-6 2up on 12 x 18 Outside Bleeds</a></li>\r\n	<li><a href="http://aze.dev.laneterralever.com/wp-content/uploads/2013/12/A-7-4-Up-on-19x25-Outside-Bleeds.pdf">A-7 4 Up on 19x25 Outside Bleeds</a></li>\r\n	<l